    .word 0x10008000
##############################################################################
# Mutable Data
##############################################################################
# Active capsule state
active_capsule_row_left:     .word 0
active_capsule_row_right:    .word 0
active_capsule_col_left:     .word 0
active_capsule_col_right:    .word 0
active_capsule_orientation:  .word 0   # 0 = horizontal, 1 = vertical

# Game over flag
game_over_flag:              .word 0   # 0 = game continues, 1 = game over
paused_flag: 	            .word 0   # 0 = game continues, 1 = game paused

# Capsule colors
capsule_color_left:       .word 0
capsule_color_right:      .word 0

# Player score
score:                       .word 0   # Initialize to 0

# Gravity counter
gravity_counter:             .word 0   # Counter for gravity timing
gravity_speed:	            .word 60
viruses_counter:             .word 0   # Counter for viruses
frame_counter:               .word 0
frame_delay:                 .word 0
frame_counter1:               .word 0
frame_delay1:                 .word 0
level_counter:	             .word 0
##############################################################################
# Code
##############################################################################
	.text
	.globl main
    # Run the game.
main:		
    # Initialize the game
inti:
    la $a1, SPRITE_FIELDS
    la $t8, JAR_LOCATION
    lw $a0, ADDR_DSPL
    li $a2, 256
    li $a3, 256
    jal draw_sprites
    
    li $t9, 4
    jal place_viruses
    
    jal place_capsule
    jal draw_capsule
    li $t0, 0
    
    jal DRAW_M3V_N
    
    j game_loop  

Exit:
    li $v0, 10 # terminate the program gracefully
    syscall

##############################################################################
# Game Loop
##############################################################################
game_loop:
    lw $t7, game_over_flag
    bnez $t7, game_over
    lw $t8, paused_flag
    bnez $t8, pause_handler
    
    jal level_update	

    jal handle_input
    
    jal draw_capsule

    lw $a2, gravity_speed
    jal gravity
    
    jal DRAW_M3V_N

    # Sleep to maintain frame rate (~60 FPS)
    li $v0, 32                      # Sleep syscall
    li $a0, 16                   
    syscall
    
    j game_loop

game_over:
    addi $t0, $zero, 1
    sw $t0, game_over_flag
    sw $zero, paused_flag

    li $a0, 0x10020188
    la $a1, SPRITE_EG
    li $a2, 60
    li $a3, 52
    jal draw_sprites

game_over_loop:
    jal handle_input

    jal DRAW_M3V
    jal DRAW_mg

    # Sleep to maintain frame rate (~60 FPS)
    li $v0, 32                      # Sleep syscall
    li $a0, 16                   
    syscall 

    j game_over_loop
    
##############################################################################
# Function: handle_input
# Handles player input for capsule movement and quitting the game
##############################################################################
handle_input:
    addi $sp, $sp, -4
    sw $ra, 0($sp)

    la $t1, game_over_flag          # Load address of game_over_flag into $t1
    lw $t0, 0($t1)
    bnez $t0, handle_go_only

    lw $t0, paused_flag
    bnez $t0, handle_pause_only
    
    lw $t0, ADDR_KBRD      
    lb $t1, 0($t0)         
    beqz $t1, no_input
    lw $t2, 4($t0)
    
    beq $t2, 0x71, game_over    # q
    beq $t2, 0x61, move_left    # a
    beq $t2, 0x64, move_right   # d
    beq $t2, 0x73, move_down    # s
    beq $t2, 0x77, rotate_right # w
    beq $t2, 0x70, toggle_pause # p
    j clear_key

handle_go_only:
    lw $t0, ADDR_KBRD
    lb $t1, 0($t0)
    beqz $t1, no_input
    lw $t2, 4($t0)
    
    beq $t2, 0x71, quit_game    # q
    beq $t2, 0x72, jump_to_main         # R
    j clear_key

jump_to_main:
    lw $t0, ADDR_KBRD
    sb $zero, 0($t0)
    sb $zero, 4($t0)
    addi $sp, $sp, 4
    jal reset_game
    j inti

handle_pause_only:
    lw $t0, ADDR_KBRD
    lb $t1, 0($t0)
    beqz $t1, no_input
    lw $t2, 4($t0)
    
    beq $t2, 0x70, toggle_pause
    beq $t2, 0x72, jump_to_main
    j clear_key

toggle_pause:
    lw $t0, paused_flag
    xori $t0, $t0, 1        
    sw $t0, paused_flag
    
    la $a0, pause_p
    la $a1, pause_i
    la $a2, pause_d
    la $a3, pause_v
    j clear_key

no_input:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra

quit_game:
    li $t0, 1
    sw $t0, game_over_flag
    j Exit

move_left:
    li $a0, 4
    jal move_capsule
    j clear_key

move_right:
    li $a0, 6
    jal move_capsule
    j clear_key

move_down:
    li $a0, 2
    jal move_capsule
    j clear_key

rotate_right:
    li $a0, 8
    jal move_capsule
    j clear_key

clear_key:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra

##############################################################################
# Function: draw_sprites
# 
##############################################################################
draw_sprites:
    # Save callee-saved registers (if used)
    addi $sp, $sp, -24        # Allocate space on the stack
    sw $s0, 0($sp)           # Save $s0
    sw $s1, 4($sp)            # Save $s1
    sw $s2, 8($sp)            # Save $s2
    sw $s3, 12($sp)           # Save $s3
    sw $t0, 16($sp)
    sw $t2, 20($sp)

    # Move parameters to temporary registers for use
    move $s0, $a0             # Base display address
    move $s1, $a1             # Base sprite data address
    move $s2, $a2             # Width
    move $s3, $a3             # Height

draw_row:
    li $t0, 0                 # Column counter
draw_column:
    lw $t2, 0($s1)            # Load pixel color from sprite data
    sw $t2, 0($s0)            # Store pixel color in display memory
    addi $s1, $s1, 4          # Next pixel in sprite data
    addi $s0, $s0, 4          # Next display pixel
    addi $t0, $t0, 1
    blt $t0, $s2, draw_column # Loop for row

    addi $s0, $s0, 1024       # Move to the next row in display memory
    mul $t2, $s2, 4           # Calculate row width in bytes
    sub $s0, $s0, $t2         # Align horizontally for next row
    addi $s3, $s3, -1         # Decrement height
    bgtz $s3, draw_row        # Loop for rows

    # Restore callee-saved registers
    lw $s0, 0($sp)            # Restore $s0
    lw $s1, 4($sp)            # Restore $s1
    lw $s2, 8($sp)            # Restore $s2
    lw $s3, 12($sp)           # Restore $s3
    lw $t0, 16($sp)
    lw $t2, 20($sp)
    addi $sp, $sp, 24         # Reset stack pointer

    jr $ra                    # Return to caller
    
##############################################################################
# Function: random_number
# 
##############################################################################
random_number:
    li $v0, 42            # Generate a random number
    add $a0, $zero, $zero
    syscall
    jr $ra
    
##############################################################################
# Function: place viruses 
# 
##############################################################################
place_viruses:
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    
    li $t1, 1
place_loop:
    bgt $t1, $t9, exit_place_viruses
   
    li $a1, 104
    jal random_number
    addi $t2, $a0, 24 

    li $t3, 8
    div $t2, $t3
    mflo $t3
    mfhi $t4
    move $a0, $t3
    move $a1, $t4
    jal check_collision
    bnez $v0, place_loop  # If occupied, try again
    
    la $t3, JAR_GRID
    add $t3, $t3, $t2
    
    li $a1, 3
    jal random_number
    addi $t0, $a0, 1
    neg $t0, $t0
    sb $t0, 0($t3)

    move $a0, $t2
    jal draw_viruses

    sw $t1, viruses_counter
    
    addi $t1, $t1, 1
    j place_loop
    
exit_place_viruses:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra

##############################################################################
# Function: draw viruses(a0:base address) 
# 
##############################################################################
draw_viruses:
    addi $sp, $sp, -12
    sw $ra, 0($sp)
    sw $s1, 4($sp)
    sw $s0, 8($sp)
    
    move $s0, $a0
    # Load color from JAR_GRID
    la $t4, JAR_GRID            # Load base address of JAR_GRID
    add $t2, $s0, $zero         # Offset = index *1 (since each cell is 1 byte)
    add $t2, $t4, $t2           # Address of JAR_GRID[index]
    lb $t0, 0($t2)              # Load color into $t0
    
    li $a2, 8
    li $a3, 8
    
    beq $t0, -1, load_sprite_yv
    beq $t0, -2, load_sprite_bv
    beq $t0, -3, load_sprite_rv
    beq $t0, 0, load_black

load_sprite_yv:
    la $a1, SPRITE_YV
    j proceed_draw
load_sprite_bv:
    la $a1, SPRITE_BV
    j proceed_draw
load_sprite_rv:
    la $a1, SPRITE_RV
    j proceed_draw
load_black:
    la $a1, BLACK
    j proceed_draw
proceed_draw: 
    la $t4, JAR_LOCATION     # Base address of JAR_LOCATION
    mul $t2, $s0, 4          # Offset = index * 4 (word size)
    add $t3, $t4, $t2        # Address in JAR_LOCATION
    lw $a0, 0($t3)           # Load display address from JAR_LOCATION[$s1]
    
    jal draw_sprites

exit_draw_viruses:
    lw $ra, 0($sp)           # Restore $s0
    lw $s1, 4($sp)           # Restore $s1
    lw $s0, 8($sp)           # Restore $ra
    addi $sp, $sp, 12        # Deallocate stack space
    jr $ra                   # Return to caller 

##############################################################################
# Function: place_capsule
##############################################################################
place_capsule:
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    
place_loop_capsule:
    li $a1, 3
    jal random_number
    addi $t0, $a0, 1          # Ensure color is between 1 and 3
    sw $t0, capsule_color_left
    
    li $a1, 3
    jal random_number
    addi $t1, $a0, 1          # Ensure color is between 1 and 3
    sw $t1, capsule_color_right
    
    # Set initial position: top-middle of the grid
    li $t2, 0                         
    li $t4, 3                 
    move $a0, $t2
    move $a1, $t4
    jal check_collision
    bnez $v0, game_over
    
    li $t3, 0
    li $t5, 4 
    move $a0, $t3
    move $a1, $t5
    jal check_collision
    bnez $v0, game_over

    sw $t2, active_capsule_row_left
    sw $t3, active_capsule_row_right
    sw $t4, active_capsule_col_left
    sw $t5, active_capsule_col_right

    li $t6, 0                 # Orientation: 0 = horizontal, 1 = vertical
    sw $t6, active_capsule_orientation

    # Place the capsule in the grid
    jal place_capsule_in_grid
    
    lw $ra, 0($sp)
    addi $sp, $sp, 4          # Return to caller
    jr $ra 
    
##############################################################################
# Function: place_capsule_in_grid
##############################################################################
place_capsule_in_grid:
    # Load capsule position and colors
    lw $t0, active_capsule_row_left     # $t0 = left row
    lw $t1, active_capsule_row_right    
    lw $t2, active_capsule_col_left     # $t1 = left column
    lw $t3, active_capsule_col_right    # $t2 = right column
    lw $t4, capsule_color_left          # $t3 = color for left half
    lw $t5, capsule_color_right         # $t4 = color for right half

    # Calculate grid indices
    mul $t6, $t0, 8                     # $t5 = row * num_columns (8)
    add $t6, $t6, $t2                   # $t6 = index for left half
    mul $t7, $t1, 8
    add $t7, $t7, $t3                   # $t7 = index for right half

    # Load base address of JAR_GRID
    la $t8, JAR_GRID

    # Place color for left half
    add $t9, $t8, $t6                   # Address for left half
    sb $t4, 0($t9)                      # Store color

    # Place color for right half
    add $t9, $t8, $t7                   # Address for right half
    sb $t5, 0($t9)                      # Store color

    jr $ra                              # Return to caller

##############################################################################
# Function: remove_capsule_in_grid
##############################################################################
remove_capsule_in_grid:
    # Load capsule position and colors
    lw $t0, active_capsule_row_left     # $t0 = left row
    lw $t1, active_capsule_row_right    
    lw $t2, active_capsule_col_left     # $t1 = left column
    lw $t3, active_capsule_col_right    # $t2 = right column

    # Calculate grid indices
    mul $t6, $t0, 8                     # $t5 = row * num_columns (8)
    add $t6, $t6, $t2                   # $t6 = index for left half
    mul $t7, $t1, 8
    add $t7, $t7, $t3                   # $t7 = index for right half

    # Load base address of JAR_GRID
    la $t8, JAR_GRID

    # Place color for left half
    add $t9, $t8, $t6                   # Address for left half
    sb $zero, 0($t9)                      # Store color

    # Place color for right half
    add $t9, $t8, $t7                   # Address for right half
    sb $zero, 0($t9)                      # Store color

    jr $ra                              # Return to caller

##############################################################################
# Function: draw_capsule
##############################################################################
draw_capsule:
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    # Load capsule position and colors
    lw $s0, active_capsule_row_left
    lw $s1, active_capsule_row_right
    lw $s2, active_capsule_col_left
    lw $s3, active_capsule_col_right
    lw $s4, active_capsule_orientation

    lw $t8, capsule_color_left
    lw $t9, capsule_color_right
    
    # Determine sprite based on orientation and color
    beq $s4, 0, draw_horizontal_capsule
    beq $s4, 1, draw_vertical_capsule
    j draw_end_capsule
    
draw_horizontal_capsule:
    # Determine sprite addresses based on color
    beq $t8, 1, use_SPRITE_YPL
    beq $t8, 2, use_SPRITE_BPL
    beq $t8, 3, use_SPRITE_RPL
    j draw_end_capsule
    
use_SPRITE_YPL:
    la $a1, SPRITE_YPL
    j draw_capsule_sprite_horizontal

use_SPRITE_BPL:
    la $a1, SPRITE_BPL
    j draw_capsule_sprite_horizontal

use_SPRITE_RPL:
    la $a1, SPRITE_RPL
    j draw_capsule_sprite_horizontal

draw_capsule_sprite_horizontal: 
    li $a2, 8		 # Width in pixels
    li $a3, 8                      # Height in pixels
    
    # Calculate grid index for left half
    mul $t0, $s0, 8
    add $t0, $t0, $s2
    # Load display address from JAR_LOCATION
    la $t1, JAR_LOCATION
    mul $t0, $t0, 4                # Offset for word address
    add $t0, $t0, $t1
    lw $a0, 0($t0)                 # Display address
    jal draw_sprites
    
    # Determine sprite for right half based on color
    beq $t9, 1, use_SPRITE_YPR
    beq $t9, 2, use_SPRITE_BPR
    beq $t9, 3, use_SPRITE_RPR
    j draw_end_capsule

use_SPRITE_YPR:
    la $a1, SPRITE_YPR
    j draw_capsule_sprite_horizontal_right

use_SPRITE_BPR:
    la $a1, SPRITE_BPR
    j draw_capsule_sprite_horizontal_right

use_SPRITE_RPR:
    la $a1, SPRITE_RPR
    j draw_capsule_sprite_horizontal_right

draw_capsule_sprite_horizontal_right:
    li $a2, 8                      # Width in pixels
    li $a3, 8                      # Height in pixels

    # Calculate grid index for right half
    mul $t0, $s1, 8
    add $t0, $t0, $s3
    # Load display address from JAR_LOCATION
    la $t1, JAR_LOCATION
    mul $t0, $t0, 4                # Offset for word address
    add $t0, $t0, $t1
    lw $a0, 0($t0)                 # Display address
    jal draw_sprites

    j draw_end_capsule
       
draw_vertical_capsule:
    # Determine sprite addresses based on color
    beq $t8, 1, use_SPRITE_YPU
    beq $t8, 2, use_SPRITE_BPU
    beq $t8, 3, use_SPRITE_RPU
    j draw_end_capsule

use_SPRITE_YPU:
    la $a1, SPRITE_YPU          # Using left half sprite for vertical top
    j draw_capsule_sprite_vertical_top

use_SPRITE_BPU:
    la $a1, SPRITE_BPU          # Using left half sprite for vertical top
    j draw_capsule_sprite_vertical_top

use_SPRITE_RPU:
    la $a1, SPRITE_RPU          # Using left half sprite for vertical top
    j draw_capsule_sprite_vertical_top

draw_capsule_sprite_vertical_top:
    li $a2, 8                      # Width in pixels
    li $a3, 8                      # Height in pixels

    # Calculate grid index for top half
    mul $t0, $s0, 8
    add $t0, $t0, $s2

    # Load display address from JAR_LOCATION
    la $t1, JAR_LOCATION
    mul $t0, $t0, 4                # Offset for word address
    add $t0, $t0, $t1
    lw $a0, 0($t0)                 # Display address
    jal draw_sprites

    # Determine sprite for bottom half based on color
    beq $t9, 1, use_SPRITE_YPD
    beq $t9, 2, use_SPRITE_BPD
    beq $t9, 3, use_SPRITE_RPD
    j draw_end_capsule

use_SPRITE_YPD:
    la $a1, SPRITE_YPD          # Using right half sprite for vertical bottom
    j draw_capsule_sprite_vertical_bottom

use_SPRITE_BPD:
    la $a1, SPRITE_BPD          # Using right half sprite for vertical bottom
    j draw_capsule_sprite_vertical_bottom

use_SPRITE_RPD:
    la $a1, SPRITE_RPD          # Using right half sprite for vertical bottom
    j draw_capsule_sprite_vertical_bottom

draw_capsule_sprite_vertical_bottom:
    li $a2, 8                      # Width in pixels
    li $a3, 8                      # Height in pixels

    # Calculate grid index for bottom half
    mul $t0, $s1, 8
    add $t0, $t0, $s3

    # Load display address from JAR_LOCATION
    la $t1, JAR_LOCATION
    mul $t0, $t0, 4                # Offset for word address
    add $t0, $t0, $t1
    lw $a0, 0($t0)                 # Display address
    jal draw_sprites

    j draw_end_capsule

draw_end_capsule:
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra                            # Return to caller    

##############################################################################
# Function: check_collision
# Checks if the given position is valid (within bounds and unoccupied)
# Inputs:
#   $a0 - Row of the cell
#   $a1 - Column of the cell
# Outputs:
#   $v0 - 0 if empty (no collision), 1 if occupied (collision)
##############################################################################
check_collision:
    # Save callee-saved registers if necessary
    addi $sp, $sp, -20
    sw $s0, 0($sp)
    sw $s1, 4($sp)
    sw $t6, 8($sp)
    sw $t7, 12($sp)
    sw $t8, 16($sp)

    move $s0, $a0      # Row
    move $s1, $a1      # Column

    # Check if position is within bounds
    bltz $s0, cell_occupied       # If row < 0
    bltz $s1, cell_occupied       # If column < 0
    bgt $s0, 15, cell_occupied   # If row > 15
    bgt $s1, 7, cell_occupied   # If column > 7

    # Calculate grid index
    mul $t7, $s0, 8               # t7 = row * 8
    add $t7, $t7, $s1             # t7 = index

    # Load base address of JAR_GRID
    la $t8, JAR_GRID

    # Check if grid position is occupied
    add $t8, $t8, $t7             # Address of grid cell
    lb $t6, 0($t8)                # Load value at grid cell
    bnez $t6, cell_occupied       # If not zero, occupied

    # Cell is empty
    li $v0, 0                     # Return value 0 (no collision)
    # Restore registers and return
    lw $s0, 0($sp)
    lw $s1, 4($sp)
    lw $t6, 8($sp)
    lw $t7, 12($sp)
    lw $t8, 16($sp)
    addi $sp, $sp, 20
    jr $ra

cell_occupied:
    li $v0, 1                     # Return value 1 (collision)
    # Restore registers and return
    lw $s0, 0($sp)
    lw $s1, 4($sp)
    lw $t6, 8($sp)
    lw $t7, 12($sp)
    lw $t8, 16($sp)
    addi $sp, $sp, 20
    jr $ra

##############################################################################
# Function: move_capsule
# Attempts to move the active capsule
##############################################################################
move_capsule:
    addi $sp, $sp, -36
    sw $ra, 0($sp)
    sw $s0, 4($sp)              # Save $s0
    sw $s1, 8($sp)              # Save $s1
    sw $s2, 12($sp)              # Save $s2
    sw $s3, 16($sp)              # Save $s3
    sw $s4, 20($sp)              # Save $s4
    sw $s5, 24($sp)
    sw $s6, 28($sp)
    sw $s7, 32($sp)

    move $s0, $a0               # Movement Direction Identifier

    # Load current capsule positions
    lw $s1, active_capsule_row_left     # Row of left half
    lw $s2, active_capsule_col_left     # Column of left half
    lw $s3, active_capsule_row_right    # Row of right half
    lw $s4, active_capsule_col_right    # Column of right half
    lw $s5, active_capsule_orientation  # Orientation

    beq $s0, 4, move_lr_proc           
    beq $s0, 6, move_lr_proc          
    beq $s0, 2, move_down_proc           # MOVE_DOWN
    beq $s0, 8, rotate_proc              # ROTATE
    j end_move_capsule                    # Invalid movement

##############################################################################
# Subroutine: move_lr_proc
##############################################################################
move_lr_proc:
    beq $s0, 4, move_l_proc           
    beq $s0, 6, move_r_proc

move_l_proc:
    addi $s6, $s2, -1            # New column for left half
    addi $s7, $s4, -1            # New column for right half
    j check_pl

move_r_proc:
    addi $s6, $s2, 1            # New column for left half
    addi $s7, $s4, 1            # New column for right half
    j check_pr

check_pl:
    # Check collision for new positions
    move $a0, $s1                 # Row of left half
    move $a1, $s6                 # New column of left half
    jal check_collision            # Check collision
    bnez $v0, skip_move_capsule            # Collision detected; skip move
    mul $t3, $s1, 8                     
    add $t3, $t3, $s2                   
    # Load base address of JAR_GRID
    la $t4, JAR_GRID
    add $t5, $t4, $t3                   # Address for left half
    sb $zero, 0($t5)                      # Store color

    move $a0, $s3                 # Row of right half
    move $a1, $s7                 # New column of right half
    jal check_collision            # Check collision
    bnez $v0, skip_move_capsule            # Collision detected; skip move
    jal proceed_move

check_pr:
    # Check collision for new positions
    move $a0, $s3                 # Row of right half
    move $a1, $s7 
    jal check_collision            # Check collision
    bnez $v0, skip_move_capsule            # Collision detected; skip move
    mul $t3, $s3, 8                     
    add $t3, $t3, $s4                   
    # Load base address of JAR_GRID
    la $t4, JAR_GRID
    add $t5, $t4, $t3                   # Address for left half
    sb $zero, 0($t5)                      # Store color

    move $a0, $s1                 # Row of left half
    move $a1, $s6                 # New column of left half
    jal check_collision            # Check collision
    bnez $v0, skip_move_capsule            # Collision detected; skip move
    jal proceed_move

proceed_move:
    # Remove capsule from current grid positions
    jal remove_capsule_in_grid

    # clear old position piexls
    mul $t1, $s1, 8
    add $t1, $s2, $t1
    add $a0, $zero, $t1
    jal draw_viruses
    mul $t1, $s3, 8
    add $t1, $s4, $t1
    add $a0, $zero, $t1
    jal draw_viruses

    # Update capsule's column positions
    sw $s6, active_capsule_col_left      # New column of left half
    sw $s7, active_capsule_col_right     # New column of right half

    # Place capsule in new grid positions
    jal place_capsule_in_grid
    j end_move_capsule

##############################################################################
# Subroutine: move_down_proc
##############################################################################
move_down_proc:
    addi $s6, $s1, 1              # New row for left half
    addi $s7, $s3, 1              # New row for right half

    # Check collision for new positions
    move $a0, $s7                 # New row of right half
    move $a1, $s4                 # Column of right half
    jal check_collision            # Check collision
    bnez $v0, fix_capsule_status
    mul $t3, $s3, 8                     
    add $t3, $t3, $s4                  
    # Load base address of JAR_GRID
    la $t4, JAR_GRID
    add $t5, $t4, $t3                   # Address for left half
    sb $zero, 0($t5)                      # Store color
    
    move $a0, $s6                 # New row of left half
    move $a1, $s2                 # Column of left half
    jal check_collision            # Check collision
    bnez $v0, fix_capsule_status
    
    jal proceed_move_down

proceed_move_down:
    # Remove capsule from current grid positions
    jal remove_capsule_in_grid

    # clear old position piexls
    mul $t1, $s1, 8
    add $t1, $s2, $t1
    add $a0, $zero, $t1
    jal draw_viruses
    mul $t1, $s3, 8
    add $t1, $s4, $t1
    add $a0, $zero, $t1
    jal draw_viruses

    # Update capsule's row positions
    sw $s6, active_capsule_row_left      # New row of left half
    sw $s7, active_capsule_row_right     # New row of right half

    # Place capsule in new grid positions
    jal place_capsule_in_grid

    j end_move_capsule
    
##############################################################################
# Subroutine: rotate_proc
##############################################################################
rotate_proc:
    beq $s5, 1, rotate_v
    beqz $s5, rotate_h
    j end_move_capsule

rotate_h:
    addi $s6, $s3, 1
    addi $s7, $s4, -1

    move $a0, $s6                 # New row of left half
    move $a1, $s7                 # Column of left half
    jal check_collision            # Check collision
    bnez $v0, skip_move_capsule
    
    # Remove capsule from current grid positions
    jal remove_capsule_in_grid

    # clear old position piexls
    mul $t1, $s1, 8
    add $t1, $s2, $t1
    add $a0, $zero, $t1
    jal draw_viruses
    mul $t1, $s3, 8
    add $t1, $s4, $t1
    add $a0, $zero, $t1
    jal draw_viruses

    # Update capsule's column positions
    sw $s6, active_capsule_row_right      # New column of left half
    sw $s7, active_capsule_col_right     # New column of right half

    lw $s6, active_capsule_orientation
    addi $s6, $zero, 1
    sw $s6, active_capsule_orientation

    # Place capsule in new grid positions
    jal place_capsule_in_grid
    j end_move_capsule

rotate_v:
    addi $s6, $s2, 1             # left col
    addi $s7, $s3, -1           # rigth row

    move $a0, $s1                 
    move $a1, $s6                 
    jal check_collision            
    bnez $v0, skip_move_capsule
    mul $t3, $s1, 8                     
    add $t3, $t3, $s2                   
    # Load base address of JAR_GRID
    la $t4, JAR_GRID
    add $t5, $t4, $t3                   # Address for left half
    sb $zero, 0($t5)                      # Store color

    move $a0, $s7                 # New row of left half
    move $a1, $s4                 # Column of left half
    jal check_collision            # Check collision
    bnez $v0, skip_move_capsule

    # Remove capsule from current grid positions
    jal remove_capsule_in_grid

    # clear old position piexls
    mul $t1, $s1, 8
    add $t1, $s2, $t1
    add $a0, $zero, $t1
    jal draw_viruses
    mul $t1, $s3, 8
    add $t1, $s4, $t1
    add $a0, $zero, $t1
    jal draw_viruses

    # Update capsule's column positions
    sw $s7, active_capsule_row_left     # Row of left half
    sw $s4, active_capsule_col_left      # New column of left half
    sw $s1, active_capsule_row_right     # New row of right half
    sw $s6, active_capsule_col_right    # Column of right half

    lw $s6, active_capsule_orientation
    add $s6, $zero, $zero
    sw $s6, active_capsule_orientation

    lw $s6, capsule_color_left
    lw $s7, capsule_color_right
    sw $s7, capsule_color_left
    sw $s6, capsule_color_right

    # Place capsule in new grid positions
    jal place_capsule_in_grid
    j end_move_capsule

##############################################################################
# Subroutine: skip_move_capsule
##############################################################################
skip_move_capsule:
    sw $s1, active_capsule_row_left     # Row of left half
    sw $s2, active_capsule_col_left     # Column of left half
    sw $s3, active_capsule_row_right    # Row of right half
    sw $s4, active_capsule_col_right    # Column of right half
    sw $s5, active_capsule_orientation  # Orientation
    jal place_capsule_in_grid
    j end_move_capsule

##############################################################################
# Subroutine: end_move_capsule
##############################################################################
end_move_capsule:
    lw $ra, 0($sp)
    lw $s0, 4($sp)              # Save $s0
    lw $s1, 8($sp)              # Save $s1
    lw $s2, 12($sp)              # Save $s2
    lw $s3, 16($sp)              # Save $s3
    lw $s4, 20($sp)              # Save $s4
    lw $s5, 24($sp)
    lw $s6, 28($sp)
    lw $s7, 32($sp)                
    addi $sp, $sp, 36                    # Deallocate stack space
    jr $ra                               # Return to caller

##############################################################################
# Function: fix_capsule_status
# Fixes the capsule in place, checks for line clears, and spawns a new capsule
##############################################################################
fix_capsule_status:
    sw $s1, active_capsule_row_left     # Row of left half
    sw $s2, active_capsule_col_left     # Column of left half
    sw $s3, active_capsule_row_right    # Row of right half
    sw $s4, active_capsule_col_right    # Column of right half
    sw $s5, active_capsule_orientation  # Orientation
    jal place_capsule_in_grid
    
    # Check and clear completed lines
    jal clear_line
    beqz $v0, skip_clear
    
    li $v0, 32                      # Sleep syscall
    li $a0, 160                 
    syscall
    jal draw_ca
    jal check_usc  
skip_clear:    
    # Spawn a new capsule
    jal place_capsule
    j end_move_capsule                   # Return to caller

##############################################################################
# Function: pause_handler
##############################################################################
pause_handler:
        # Display the pause screen
        jal draw_pause_screen
        
    wait_resume:
        # Wait until the player resumes the game by pressing 'p'
        jal handle_input              # Handle input to check for 'p' again
        
        # Check if the game is still paused
        lw $t0, paused_flag
        bnez $t0, wait_resume        # If still paused, continue waiting
        
        # Remove the pause screen
        jal remove_pause_screen
        
        j game_loop

##############################################################################
# Function: draw_pause_screen
##############################################################################
draw_pause_screen:
    addi $sp, $sp, -32
    sw $ra, 0($sp)
    sw $s0, 4($sp)
    sw $s1, 8($sp)
    sw $s2, 12($sp)
    sw $s3, 16($sp)
    sw $t0, 20($sp)
    sw $t1, 24($sp)
    sw $t2, 28($sp)

    la $s0, SPRITE_PAUSE_ADDRESS
    la $s1, SPRITE_OR
    li $s2, 0

store_sprite_or:
    lw $s3, 0($s0)
    lw $t0, 0($s3)
    sw $t0, 0($s1)
    addi $s0, $s0, 4
    addi $s1, $s1, 4
    addi $s2, $s2, 1
    bne $s2, 1128, store_sprite_or
    
    la $s0, SPRITE_PAUSE_ADDRESS
    li $s2, 0

draw_pause_screen_loop:
    beq $s2, 1128, draw_pause_screen_end
    addi $t0, $zero, 0xffffff
    lw $s3, 0($s0)
    sw $t0, 0($s3)

    addi $s0, $s0, 4
    addi $s2, $s2, 1
    j draw_pause_screen_loop

draw_pause_screen_end:
    lw $ra, 0($sp)
    lw $s0, 4($sp)
    lw $s1, 8($sp)
    lw $s2, 12($sp)
    lw $s3, 16($sp)
    lw $t0, 20($sp)
    lw $t1, 24($sp)
    lw $t2, 28($sp)
    addi $sp, $sp, 32
    jr $ra

##############################################################################
# Function: remove_pause_screen
##############################################################################
remove_pause_screen:
    addi $sp, $sp, -32
    sw $ra, 0($sp)
    sw $s0, 4($sp)
    sw $s1, 8($sp)
    sw $s2, 12($sp)
    sw $s3, 16($sp)
    sw $t0, 20($sp)
    sw $t1, 24($sp)
    sw $t2, 28($sp)

    la $s0, SPRITE_PAUSE_ADDRESS
    la $s1, SPRITE_OR
    li $s2, 0

draw_or_screen_loop:
    beq $s2, 1128, draw_or_screen_end
    lw $t0, 0($s1)
    lw $s3, 0($s0)
    sw $t0, 0($s3)

    addi $s0, $s0, 4
    addi $s2, $s2, 1
    addi $s1, $s1, 4
    j draw_or_screen_loop

draw_or_screen_end:
    lw $ra, 0($sp)
    lw $s0, 4($sp)
    lw $s1, 8($sp)
    lw $s2, 12($sp)
    lw $s3, 16($sp)
    lw $t0, 20($sp)
    lw $t1, 24($sp)
    lw $t2, 28($sp)
    addi $sp, $sp, 32
    jr $ra  

##############################################################################
# Function: gravity
# a2 - level
##############################################################################
gravity:
    addi $sp, $sp, -16
    sw $ra, 0($sp)
    sw $s0, 4($sp)
    sw $s1, 8($sp)
    sw $s2, 12($sp)

    lw $s1, gravity_counter               # Load current gravity counter
    addi $s1, $s1, 1                      # Increment counter
    move $s0, $a2                            # Threshold for moving down (e.g., every 60 cycles)
    blt $s1, $s0, skip_gravity             # If counter < threshold, skip moving down

    # Reset counter
    li $s1, 0

    # Move capsule down
    li $a0, 2 
    jal move_capsule

skip_gravity:
    sw $s1, gravity_counter
    lw $ra, 0($sp)
    lw $s0, 4($sp)
    lw $s1, 8($sp)
    lw $s2, 12($sp)
    addi $sp, $sp, 16
    jr $ra  

