##############################################################################
# Function: reset_game
##############################################################################
reset_game:
    li $t0, 0
    sw $t0, game_over_flag
    sw $t0, gravity_counter
    sw $t0, viruses_counter
    move $s0, $t0
    move $s1, $t0
    move $s2, $t0
    move $s3, $t0
    move $s4, $t0
    move $s5, $t0
    move $s6, $t0
    move $s7, $t0
    move $t0, $t0
    move $t1, $t0
    move $t2, $t0
    move $t3, $t0
    move $t4, $t0
    move $t5, $t0
    move $t6, $t0
    move $t7, $t0
    move $t8, $t0
    move $t9, $t0
    move $a0, $t0
    move $a1, $t0
    move $a2, $t0
    move $a3, $t0
    la $s1, JAR_GRID
reset_jar:
    sb $t0, 0($s1)
    addi $s1, $s1, 1
    addi $s0, $s0, 1
    blt $s0, 128, reset_jar
    
    lw $s1, ADDR_DSPL
reset_field:
    sw $t0, 0($s1)
    addi $s1, $s1, 4
    addi $s0, $s0, 1
    blt $s0, 65535, reset_field

    move $s0, $t0
    move $s1, $t0
    jr $ra
    
##############################################################################
# Function: clear_line
##############################################################################
clear_line:
    addi $sp, $sp, -60
    sw $ra, 0($sp)
    sw $s0, 4($sp)            
    sw $t0, 8($sp)              
    sw $t1, 12($sp)              
    sw $t2, 16($sp)
    sw $t3, 20($sp)
    sw $t4, 24($sp)
    sw $t5, 28($sp)
    sw $t6, 32($sp)
    sw $t7, 36($sp)
    sw $t8, 40($sp)
    sw $t9, 44($sp)
    sw $s1, 48($sp)
    sw $s2, 52($sp)
    sw $s3, 56($sp)
    
    # Initialize loop variables
    li $t0, 0                  # Row index
    li $t1, 0                  # Column index

    # Row-by-row scan for horizontal groups
horizontal_scan:
    blt $t0, 16, horizontal_check
    j vertical_scan    
horizontal_check:
    li $t2, 0                  # Start at the first column
horizontal_loop:
    bge $t2, 5, next_row       # Stop at column 5 (last 4 columns already checked)
    # Load the current block and the next three blocks
    mul $t3, $t0, 8            # t3 = row index * 8 (grid width)
    add $t3, $t3, $t2          
    la $t8, JAR_GRID
    add $t3, $t8, $t3          # Address of the current block
    lb $t4, 0($t3)             # Load block value

    # Check the next three blocks
    lb $t5, 1($t3)
    lb $t6, 2($t3)
    lb $t7, 3($t3)

    add $a0, $t5, $zero
    jal abs
    move $t5, $v0

    add $a0, $t6, $zero
    jal abs
    move $t6, $v0

    add $a0, $t7, $zero
    jal abs
    move $t7, $v0

    add $a0, $t4, $zero
    jal abs
    move $t4, $v0
    
    beq $t4, 0, continue_horizontal
    beq $t5, 0, continue_horizontal
    beq $t6, 0, continue_horizontal
    beq $t7, 0, continue_horizontal
    
    blt $t4, 4, check_5_h
    addi $t4, $t4, -4
check_5_h:
    blt $t5, 4, check_6_h
    addi $t5, $t5, -4
check_6_h:
    blt $t6, 4, check_7_h
    addi $t6, $t6, -4
check_7_h:
    blt $t7, 4, check_h
    addi $t7, $t7, -4
    
check_h:
    # If all are the same and not empty, mark them
    beq $t4, $t5, check_2
    j continue_horizontal
check_2:
    beq $t5, $t6, check_3
    j continue_horizontal
check_3:
    beq $t6, $t7, mark_horizontal
    j continue_horizontal

mark_horizontal:
    addi $t4, $t4, 4
    sb $t4, 0($t3)
    sb $t4, 1($t3)
    sb $t4, 2($t3)
    sb $t4, 3($t3)    

continue_horizontal:
    addi $t2, $t2, 1
    j horizontal_loop

next_row:
    addi $t0, $t0, 1
    j horizontal_scan

# Repeat the same process for vertical scanning
vertical_scan:
    li $t1, 0                  # Column index
vertical_check:
    blt $t1, 8, vertical_loop
    j clean_start

vertical_loop:
    li $t0, 0                  # Start at the first row
vertical_inner_loop:
    bge $t0, 13, next_col      # Stop at row 13 (last 4 rows already checked)

    # Load the current block and the next three blocks vertically
    mul $t3, $t0, 8            # t3 = row index * 8
    add $t3, $t3, $t1          
    add $t3, $t3, $t8          # Address of the current block
    lb $t4, 0($t3)             # Load block value

    # Check the next three blocks in the column
    lb $t5, 8($t3)
    lb $t6, 16($t3)
    lb $t7, 24($t3)

    add $a0, $t5, $zero
    jal abs
    move $t5, $v0

    add $a0, $t6, $zero
    jal abs
    move $t6, $v0

    add $a0, $t7, $zero
    jal abs
    move $t7, $v0

    add $a0, $t4, $zero
    jal abs
    move $t4, $v0
    
    beq $t4, 0, continue_vertical
    beq $t5, 0, continue_vertical
    beq $t6, 0, continue_vertical
    beq $t7, 0, continue_vertical
    
    blt $t4, 4, check_5_v
    addi $t4, $t4, -4
check_5_v:
    blt $t5, 4, check_6_v
    addi $t5, $t5, -4
check_6_v:
    blt $t6, 4, check_7_v
    addi $t6, $t6, -4
check_7_v:
    blt $t7, 4, check_v
    addi $t7, $t7, -4
    
check_v:
    # If all are the same and not empty, mark them
    beq $t4, $t5, check_v2
    j continue_vertical
check_v2:
    beq $t5, $t6, check_v3
    j continue_vertical
check_v3:
    beq $t6, $t7, mark_vertical
    j continue_vertical

mark_vertical:
    addi $t4, $t4, 4
    sb $t4, 0($t3)
    sb $t4, 8($t3)
    sb $t4, 16($t3)
    sb $t4, 24($t3) 

continue_vertical:
    addi $t0, $t0, 1
    j vertical_inner_loop

next_col:
    addi $t1, $t1, 1
    j vertical_check

clean_start:
    # after work, clean up
    la $s0, JAR_GRID
    la $s1, JAR_LOCATION
    li $s2, 0
    li $t3, 0
    li $s3, 0
grid_loop:
    bge $s3, 128, end_clear_line
    lb $t3, 0($s0)
    beqz $t3, proceed_clean
    bgtz $t3, check_clean 
    addi $s2, $s2, 1
    j proceed_clean
check_clean:
    addi $v0, $v0, 1
    beq $t3, 5, draw_YC
    beq $t3, 6, draw_BC
    beq $t3, 7, draw_RC
    j proceed_clean

draw_YC:
    la $a1, SPRITE_YC 
    j draw_c
draw_BC:
    la $a1, SPRITE_BC
    j draw_c
draw_RC:
    la $a1, SPRITE_RC

draw_c:
    lw $a0, 0($s1)
    li $a2, 8
    li $a3, 8
    jal draw_sprites
    
    li $v0, 1
    
    li $t9, 9
    sb $t9, 0($s0)

proceed_clean:
    addi $s3, $s3, 1
    addi $s0, $s0, 1
    addi $s1, $s1, 4
    j grid_loop

end_clear_line:
    sw $s2, viruses_counter
    lw $ra, 0($sp)
    lw $s0, 4($sp)             
    lw $t0, 8($sp)              
    lw $t1, 12($sp)              
    lw $t2, 16($sp)
    lw $t3, 20($sp)
    lw $t4, 24($sp)
    lw $t5, 28($sp)
    lw $t6, 32($sp)
    lw $t7, 36($sp)
    lw $t8, 40($sp)
    lw $t9, 44($sp)
    lw $s1, 48($sp)
    lw $s2, 52($sp) 
    lw $s3, 56($sp)        
    addi $sp, $sp, 60
    jr $ra 

##############################################################################
# Function: draw_ca
##############################################################################
draw_ca:
    addi $sp, $sp, -60
    sw $ra, 0($sp)
    sw $s0, 4($sp)            
    sw $t0, 8($sp)              
    sw $t1, 12($sp)              
    sw $t2, 16($sp)
    sw $t3, 20($sp)
    sw $t4, 24($sp)
    sw $t5, 28($sp)
    sw $t6, 32($sp)
    sw $s6, 36($sp)
    sw $s5, 40($sp)
    sw $s4, 44($sp)
    sw $s1, 48($sp)
    sw $s2, 52($sp)
    sw $s3, 56($sp)

    la $s0, JAR_GRID
    la $s1, JAR_LOCATION
    li $t3, 0
    li $s3, 0

draw_ca_loop:
    bge $s3, 128, end_ca
    lb $t3, 0($s0)
    beq $t3, 9, clear_a
    j proceed_ca
    
clear_a:
    li $v0, 1
    lw $a0, 0($s1)
    li $a2, 8
    li $a3, 8
    la $a1, BLACK
    jal draw_sprites
    sb $zero, 0($s0)

proceed_ca:
    addi $s3, $s3, 1
    addi $s0, $s0, 1
    addi $s1, $s1, 4
    j draw_ca_loop

end_ca:
    lw $ra, 0($sp)
    lw $s0, 4($sp)             
    lw $t0, 8($sp)              
    lw $t1, 12($sp)              
    lw $t2, 16($sp)
    lw $t3, 20($sp)
    lw $t4, 24($sp)
    lw $t5, 28($sp)
    lw $t6, 32($sp)
    lw $s6, 36($sp)
    lw $s5, 40($sp)
    lw $s4, 44($sp)
    lw $s1, 48($sp)
    lw $s2, 52($sp) 
    lw $s3, 56($sp)        
    addi $sp, $sp, 60
    jr $ra 

##############################################################################
# Function: check_usc
##############################################################################
check_usc:
    addi $sp, $sp, -60          # Save stack space
    sw $ra, 0($sp)              # Save return address
    sw $s0, 4($sp)              # Save temporary registers
    sw $t0, 8($sp)
    sw $t1, 12($sp)
    sw $t2, 16($sp)
    sw $t3, 20($sp)
    sw $t4, 24($sp)
    sw $t5, 28($sp)
    sw $t6, 32($sp)
    sw $s6, 36($sp)
    sw $s5, 40($sp)
    sw $s4, 44($sp)
    sw $s1, 48($sp)
    sw $s2, 52($sp)
    sw $s3, 56($sp)

gravity_main_loop:
    li $s0, 14                  # Start from the second-to-last row (row index 14)

gravity_row_loop:
    bltz $s0, gravity_done      # Exit if row < 0
    li $s1, 0                   # Initialize column index to 0

gravity_col_loop:
    bge $s1, 8, next_gravity_row # Exit if column >= 8

    # Calculate current cell index
    mul $t0, $s0, 8             # $t0 = row index * 8
    add $t1, $t0, $s1           # $t1 = index of the current cell
    la $t2, JAR_GRID            # Load grid base address
    add $t3, $t2, $t1           # $t3 = address of current cell
    lb $t4, 0($t3)              # Load block value (pill or virus)

    # Skip if not an unsupported capsule (pill: 1, 2, 3)
    blt $t4, 1, continue_gravity_col
    bgt $t4, 3, continue_gravity_col

    # Loop to move the pill down until collision
unsupported_capsule_loop:
    # Check if the cell below is empty
    addi $a0, $s0, 1            # $a0 = row below
    add $a1, $zero, $s1         # $a1 = current column
    jal check_collision         # Call check_collision
    bnez $v0, unsupported_capsule_done # Exit loop if the cell below is occupied

    # Erase current pill by drawing a black box
    la $a1, BLACK               # Black sprite to erase
    la $t5, JAR_LOCATION
    mul $t6, $s0, 8             # Offset = row * 8
    add $t6, $t6, $s1           # Offset += column
    mul $t6, $t6, 4
    add $t6, $t6, $t5
    lw $a0, 0($t6)         
    li $a2, 8                   # Width
    li $a3, 8                   # Height
    jal draw_sprites            # Draw black box

    addi $s0, $s0, 1

    # Move the pill down by 1 row
    sb $zero, 0($t3)            # Clear original position
    addi $t1, $t1, 8            # Move to the cell below
    add $t3, $t2, $t1           # Address of the new cell
    sb $t4, 0($t3)              # Place pill in the new cell

    # Draw pill at the new position
    beq $t4, 1, draw_pill_1
    beq $t4, 2, draw_pill_2
    beq $t4, 3, draw_pill_3
    j unsupported_capsule_loop
    
draw_pill_1:
    la $a1, SPRITE_YSP
    j draw_new_pill
draw_pill_2:
    la $a1, SPRITE_BSP
    j draw_new_pill
draw_pill_3:
    la $a1, SPRITE_RSP
    j draw_new_pill

draw_new_pill:
    la $t5, JAR_LOCATION
    mul $t6, $s0, 8             # Offset = row * 8
    add $t6, $t6, $s1           # Offset += column
    mul $t6, $t6, 4
    add $t6, $t6, $t5
    lw $a0, 0($t6)         
    li $a2, 8                   # Width
    li $a3, 8                   # Height
    jal draw_sprites            # Draw pill sprite

    # Add delay for animation
    li $v0, 32                  # Delay duration
    li $a0, 16
    syscall                     # Add delay for smooth animation

    j unsupported_capsule_loop

unsupported_capsule_done:
    # Done moving this pill, continue to the next column
    j continue_gravity_col

continue_gravity_col:
    addi $s1, $s1, 1            # Move to the next column
    j gravity_col_loop

next_gravity_row:
    addi $s0, $s0, -1           # Move to the previous row
    j gravity_row_loop

gravity_done:
    lw $ra, 0($sp)
    lw $s0, 4($sp)             
    lw $t0, 8($sp)              
    lw $t1, 12($sp)              
    lw $t2, 16($sp)
    lw $t3, 20($sp)
    lw $t4, 24($sp)
    lw $t5, 28($sp)
    lw $t6, 32($sp)
    lw $s6, 36($sp)
    lw $s5, 40($sp)
    lw $s4, 44($sp)
    lw $s1, 48($sp)
    lw $s2, 52($sp) 
    lw $s3, 56($sp)        
    addi $sp, $sp, 60
    jr $ra  

##############################################################################
# Function: abs
##############################################################################
abs:
    addi $sp, $sp, -12
    sw $ra, 0($sp)
    sw $t0, 4($sp)            
    sw $t1, 8($sp)

    move $t0, $a0
    sra $t1, $t0, 31
    xor $v0, $t0, $t1
    sub $v0, $v0, $t1
           
    lw $ra, 0($sp)
    lw $t0, 4($sp)            
    lw $t1, 8($sp)                           
    addi $sp, $sp, 12
    jr $ra 

##############################################################################
# Function: level_update
##############################################################################
level_update:
    addi $sp, $sp, -36
    sw $ra, 0($sp)
    sw $s0, 4($sp)            
    sw $s1, 8($sp)
    sw $s2, 12($sp)
    sw $t9, 16($sp)
    sw $s3, 20($sp)
    sw $s4, 24($sp)
    sw $s5, 28($sp)
    sw $s6, 32($sp)
    
    lw $s0, viruses_counter
    lw $s1, level_counter
    lw $s2, gravity_speed
    
    bnez $s0, end_level_update
    beq $s1, 20, special_ending
    
    addi $s1, $s1, 1
    sw $s1, level_counter
    
    addi $s2, $s2, -3
    sw $s2, gravity_speed
    
    la $s4, JAR_GRID
    add $s5, $zero, $zero
reset_jar_level:
    sb $zero, 0($s4)
    addi $s4, $s4, 1
    addi $s5, $s5, 1
    blt $s5, 128, reset_jar_level
    
    la $s6, JAR_LOCATION
    add $s5, $zero, $zero
reset_jar_FIELD:
    lw $a0, 0($s6)
    la $a1, BLACK
    li $a2, 8
    li $a3, 8
    jal draw_sprites
    addi $s6, $s6, 4
    addi $s5, $s5, 1
    blt $s5, 128, reset_jar_FIELD    
    
    mul $t9, $s1, 4
    jal place_viruses
    j end_level_update

special_ending:
    lw $s3, game_over_flag
    addi $s3, $zero, 1
    sw $s3, game_over_flag

end_level_update:         
    lw $ra, 0($sp)
    lw $s0, 4($sp)            
    lw $s1, 8($sp)
    lw $s2, 12($sp)
    lw $t9, 16($sp)
    lw $s3, 20($sp)
    lw $s4, 24($sp)
    lw $s5, 28($sp)
    lw $s6, 32($sp)                           
    addi $sp, $sp, 36
    jr $ra 

##############################################################################
# Function: play_sound
##############################################################################
play_sound:
    addi $sp, $sp, -24
    sw $s0, 0($sp)
    sw $s1, 4($sp)
    sw $s2, 8($sp)
    sw $s3, 12($sp)
    sw $s4, 16($sp)
    sw $t0, 20($sp)
    
    move $s0, $a0
    move $s1, $a1
    move $s2, $a2
    move $s3, $a3   

play_s_loop:
    lw $t0, 0($s0)            # Load current pitch
    beq $t0, -1, play_s_loop_end  # If pitch == -1, exit the loop    
    
    li $v0, 31
    lw $a0, 0($s0)
    lw $a1, 0($s1)
    lw $a2, 0($s2)
    lw $a3, 0($s3)
    syscall
   
    addi $s0, $s0, 4
    addi $s1, $s1, 4
    addi $s2, $s2, 4
    addi $s3, $s3, 4
    
    j play_s_loop

play_s_loop_end:    
    lw $s0, 0($sp)
    lw $s1, 4($sp)
    lw $s2, 8($sp)
    lw $s3, 12($sp)
    lw $s4, 16($sp)
    lw $t0, 20($sp)
    addi $sp, $sp, 24
    jr $ra    
